What happened in Washington this week?

@HouseDemocrats introduced over 500 amendments to shine a light on @HouseGOP's Big Ugly Bill that would rip healthcare away from nearly 14 million Americans.

A quick recap from me in my FIRST edition of #RivasRewind ⏪ https://t.co/99DFIQjBlY

After long nights and days of negotiations, the One Big Beautiful Bill delivers.

— $12B to reimburse states, like Texas, for border security;
— $1.6T in savings, the largest deficit reduction in nearly 30 years;
— and historic defense investments, including the Golden Dome.

There’s plenty of more work ahead, but here are a few wins. We’re just getting started.

(3/4) The final bill obtains a true repeal of Green New Scam wind and solar subsidies for new projects starting 60 days after the bill is signed into law. It moves Medicaid work requirements up to 2026, restoring the dignity of work in America. And it prohibits taxpayer funds via Medicaid paying for transgender surgeries for adults. 

And again, the math works now—in keeping with our Budget Committee’s blueprint regarding CBO scores on savings in tandem with growth expectations as tied to President Trump’s first term. These important revisions clarified my decision to finally support the bill and were in line with what I know is truthful, of both my convictions and yours. I was able to have upright intentions after close examination. 

In addition to all these other things we’ve worked on, some additional victories in the bill include:

• Preventing a 24% tax hike on the average eastern Oklahoman; 
• Investing a historic $81 billion in Border Security to build the wall, increase the number of border patrol agents, and acquire technologies to prevent the flow of illicit drugs like fentanyl into our country; 
• Including the REINS Act, which prevents bureaucrats from issuing costly rules that will increase inflation and harm our economy (which I had the honor of adding to the bill in the Budget Committee); 
• Removing suppressors from the National Firearm Registry, restoring the right of law-abiding Americans to bear arms; 
• Providing tax relief for our great seniors; 
• Implementing a tax on remittances to ensure money earned in the United States goes to supporting American businesses and communities; 
• Expediting permitting to promote American energy dominance; 
• Requiring an accelerated audit of the Department of Defense 

In my discussions with the Budget Committee, their score—based upon the work of @chiproytx, @RepRalphNorman, @Rep_Clyde, and myself to negotiate these changes—would save between $100-130 billion dollars in savings over the next 10 years. Additionally, we also legitimized the previous savings that the CBO had scored relative to ending the Green New Scam, whereas before it was calculated on what was never going to happen, based on history. 

The final product is not complete as this bill now heads to the Senate. My hope is that all the good we did will hold solid moving forward. I stayed prayerful throughout this entire process, analyzing motives and truth. 

I want to thank President @realDonaldTrump and his team and @SpeakerJohnson for giving us the runway to strengthen conservative commitments in the One Big Beautiful Bill. And I am even more grateful for your trust as I continue to represent your values and, to the best of my ability, uphold the convictions we as Oklahomans hold dear.

